import React from 'react';
import Button from '../components/Button';

export default function HomePage() {
	return (
		<div>
			<h1>Wok on NEXT</h1>
			<img src="http://www.wok88.se/logotype.png" alt="drag-on" />
			<div className={'nav-bar'}>
				<ul>
					<li>
						<a href="/">Hem</a>
					</li>
					<li>
						<button>
							{' '}
							<a href="/lunch">Lunchmeny</a>{' '}
						</button>
					</li>
					<li>
						{' '}
						<a href="/carte">A la carte</a>{' '}
					</li>
					<li>
						<a href="/contact">Contact Us</a>{' '}
					</li>
					<li>
						<Button text={'Lunch Me'} link={'/woot'} />
					</li>
				</ul>
			</div>

			<a href="/lunchmenu">Lunch</a>
			<button>Button</button>
			<a class="button">Link</a>
			<button>press</button>
			<style jsx>{`
				.nav-bar {
					display: flex;
					flex-direction: row;
					justify-content: space-around;
					background: #e30613;
					text-decoration: none;
				}
				ul {
					list-style-type: none;
				}
			`}</style>

			<style global jsx>{`
				body {
					background: #fffff0;
				}
			`}</style>
		</div>
	);
}

// #e30613 header color
